import React,{Component} from 'react'
class KnowList extends Component{
	render(){
		return(
            <div className="main-contend">
            Sở hữu thiết kế và chất lượng cao cấp, Đồng hồ không chỉ là một phụ kiện xem giờ mà còn trở thành biểu
            tượng tạo dựng nên phong cách riêng của chủ sở hữu.<br />
            Cùng khám phá những mẫu đồng hồ đeo tay chính hãng đến từ các thương hiệu nổi tiếng của Nhật Bản, Thụy
            Sĩ, Hoa Kỳ, Tây Ban Nha, Đức,... được Xwatch phân phối để tìm kiếm tri kỷ thời gian và khẳng định phong
            cách của riêng mình.<br />
            Duy nhất tại Xwatch, khi mua đồng hồ bạn sẽ được hưởng chế độ bảo hiểm CẢ LỖI NGƯỜI DÙNG cùng cam kết
            đền gấp 10 lần nếu phát hiện hàng fake<br />
          </div>
        
      
)
}
}
export default KnowList;
